  const [location, setLocation] = useState({
    from: '',
    to: ''
  })

  useEffect(() => {
    console.log(location.to)
  }, [location])

  const onClickValueChange = event => {
    console.log(event.target)
  }

  return (
    <div className='app'>
      <Navbar />
      <form action=''>
        <div className='app__form'>
          <Field text='From' name='From' value={location.from} />
          <Field text='To' name='To' value={location.To} />
          <button className='app__verticalButton' onClick={onClickValueChange}>
            <SwapVerticalCircleOutlinedIcon fontSize='large' />
          </button>
        </div>
      </form>
    </div>
  )
}

export default App
